let Home = ()=>{
    let mystyle = {
        minHeight : "650px",
        backgroundColor : "#CCC",
        width : "100%"
    }

    let x = "red";
    let y = "blue";
    let mycolor = {
        color : x,
        fontSize : "40px"
    }



    return(
        <>
        <div style={mystyle}>
            <h1 style={mycolor}>This is Home Page</h1>
            <p style={mycolor}>Lorem ipsum dolor, sit amet consectetur adipisicing elit. Inventore adipisci sequi voluptas recusandae deleniti numquam ducimus cum soluta, obcaecati tempora voluptatem cupiditate dolore. Fugiat dolores aspernatur id animi doloribus dignissimos?</p>
        </div>
        </>
    )
}

export default Home;
